css:
@-moz-document
	url-prefix('http://www.tumblr.com/'),
	url-prefix('https://www.tumblr.com/')
{

.new_post_label:hover {background-color: rgba(0,0,0,.3) !important}
.new_post_label > SPAN { font-size: 0 }
.new_post_label > I { display: none }
#new_post{ background: url('data:image/png;base64,') center no-repeat white !important }

}
